import styled from "styled-components";

const Container = styled.div`
  width: 100%;
  height: 6vh;

  border-bottom: 1px solid gray;

  position: sticky;
  top: 0;
  z-index: 100;
`;

export default function DetailBar() {
  return <Container></Container>;
}
